        "text" : "おおまかに言うと：\n• アクセントは語ごとに位置を指定する。\n• 声調は語ごとに種類を指定する。\nという定義が日琉語学では一般的だとわたしは思っています。\n形態に関しては↓を参照してください。（ただ，書いてないタイプのもありますので全てはアイディア次第です……）（基本的に遠隔音韻化transphonologisationによって出現させられるので）\nhttps://t.co/K4uBWGtIVB https://t.co/4bENuBgDQo",
