        "text" : "世界をただ消費する対象にしてから，どれほど経ったか。この上なく冷たい冬が幾度かきて，うだるような暑さは去ったのか。静かな花は何回枯れたのか。隠《おも》うに，このような推測は虚しい。むろん，目的を持ち，そのうえ新鮮な心で世界に相対することが出来るというのなら，わたしは賛辞を送ろう。しかしながら一つだけ言えることは，世界を徒《た》だ消費する，という表現は受動的な生き方を蔑んでいるだけだということである。受動的な生き方がなぜ蔑まれなければならないのだろうか？\n世界は本当に，心から消費することができるのだろうか。つまりは，無限に積み重なる不確実な因果の中に，心なんてものがあるといえようか？",
