        "recipientId" : "1122422588674732033",
        "text" : "智識が魂に保存せられるというのは残念ながら錯覚であるわけで、然るが故に世界を脳を通して観測する主体が魂であると考えなければならないのだけれども、魂の連続性を仮定しても脳の思考結果が連続していないから、観測そのものが常に不連続だとわかって、魂の想定は心の平穏に全然無意味になりうる。\n著重眞雪 Majukyi K.S.\n@MajukyiSanapey\n·\n2月16日\nいや、無個性な世界の構成物であっても世界の終わりまで自分の核が残ると考えるのは、案外良い考えなのかも知れない。輪廻は信じておくか。\n著重眞雪 Majukyi K.S.\n@MajukyiSanapey\n·\n2月16日\n創造主が人間に対して人間の考えるレヴェルで慈悲深いという教義はなかなか受け入れられない。主は全く苛烈ではないが柔和でもないというところかなと思っている。",
