        "text" : "上代日本語に関する日本語文献でしたら。\n\n・高校古典文法の智識がある(前提)\n\n【なんとなく知りたい】\nWikipedia「日琉祖語」(ただし、最後の自称同根語は明らかな独自研究でダメダメなので無視)→時代別国語大辞典——上代編\n\n【語源関係の話が知りたい】\nWikipedia『日琉祖語』を読んだ後、批判的に蜂谷真郷などの古代語形態論研究を読む。\n\n【文法が知りたい】\n→岩波古語辞典の最後の助詞解説や、小田勝などによる文法に関する研究を読む。\n\n【音韻が知りたい】\n早田輝洋《上代日本語の音韻》\n↑正直、これでは足らないので英語も読むべきではある。\n\n【歴史語用論や歴史社会言語学が知りたい】\n・日本語で書かれた入門書はあるが、未発達なので分からない。",
